import { CallbackConstructorRegistry } from '@tensorflow/tfjs-layers/dist/base_callbacks';
import React, { Component } from 'react';
import { Route, Switch } from 'react-router-dom';
import Practice from './pages/practice';

class App extends Component {
  constructor(){
    super();
    this.state= {
      letter:0,
    }
  }
  render() {

    const change=()=>{
      for(let i=0;i<2;i++){
      this.setState({letter:3});
      }
      console.log(this.state.letter);
    }
    const App = () => (

      <div>
        <Switch>
          <Route exact path='/practice'   render={() => (
            <Practice
            //pass the props through the route
              letter={this.state.letter}
            />
          )}
          exact={true}/>

<Route exact path='/'   render={() => (
           <button onClick={change}>Change Letter</button>
          )}
          exact={true}/>
        </Switch>
      </div>
    )
    return (
      <Switch>
        <App/>
      </Switch>
    );
  }
}

export default App;
